(function (jsPDFAPI) {
    const font = '';
    const callAddFont = function () {
    this.addFileToVFS('Roboto-Regular-normal.ttf', font);
    this.addFont('Roboto-Regular-normal.ttf', 'Roboto', 'normal');
    };
    jsPDF.API.events.push(['addFonts', callAddFont])
})(jsPDF.API);

(function (jsPDFAPI) {
    const font = '';
    const callAddFont = function () {
    this.addFileToVFS('Roboto-Italic-italic.ttf', font);
    this.addFont('Roboto-Italic-italic.ttf', 'Roboto', 'italic');
    };
    jsPDF.API.events.push(['addFonts', callAddFont])
})(jsPDF.API);

(function (jsPDFAPI) {
    const font = '';
    const callAddFont = function () {
    this.addFileToVFS('Roboto-Bold-bold.ttf', font);
    this.addFont('Roboto-Bold-bold.ttf', 'Roboto', 'bold');
    };
    jsPDF.API.events.push(['addFonts', callAddFont])
})(jsPDF.API);

